import React from "react";

function ImageList(props) {
  return (
    <div>
      <div>
        {props.images.length > 0 &&
          props.images.map((image) => {
            return <p key={image.id}>{image.tags}</p>;
          })}
      </div>
    </div>
  );
}

export default ImageList;
